import React from "react";

function Navbar() {
return (
    <div>
        <div className="bname" href="#">Video Processor</div>
        <div className="upload" href="#">
            <img src={`${process.env.PUBLIC_URL}/upload.png`} style={{ width: '20px', height: '20px',marginRight:'10px'}}  alt="Upload" />
            <button className="bt">Upload</button>
        </div>
    </div>
);
}

export default Navbar;
